export const HamburgerMenu: React.FC = () => {
    const [isClicked, setIsClicked] = useState(false);
    const {isOpen,setIsOpen} = useIsOpenContext();
  
    return (
      <div className="px-2 py-1">

      <button
        className="group flex flex-col justify-center items-center w-6 h-6 space-y-1"
        onClick={() => {
          if(isOpen){setIsOpen(false)}else{setIsOpen(true)}
          setIsClicked(true);
          setTimeout(() => setIsClicked(false), 100); // Reset after animation
        }}
        >
        {/* Top Line */}
        <span
          className={`block h-0.5 bg-gray-600 rounded transition-all duration-300 ${
            isClicked ? "w-[60%]" : "w-full"
          }`}
          ></span>
  
        {/* Middle Line */}
        <span
          className={`block h-0.5 bg-gray-600 rounded transition-all duration-300 ${
            isClicked ? "w-[60%]" : "w-full"
          }`}
          ></span>
  
        {/* Bottom Line */}
        <span
          className={`block h-0.5 bg-gray-600 rounded transition-all duration-300 ${
            isClicked ? "w-[60%]" : "w-full"
          }`}
          ></span>
      </button>
          </div>
    );
  };